<script>var __DATABRICKS_NOTEBOOK_MODEL = {"version":"NotebookV1","origId":226609,"name":"999_05_StudentProject_HailScalaGenomicsETLTutorial","language":"scala","commands":[{"version":"CommandV1","origId":226725,"guid":"f8a707ef-d44d-4426-9951-185fb1014ff0","subtype":"command","commandType":"auto","position":0.03125,"command":"%md\n\n# [SDS-2.2, Scalable Data Science](https://lamastex.github.io/scalable-data-science/sds/2/2/)","commandVersion":0,"state":"error","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":0,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"c29d0f51-7aa8-45d3-9dac-13563f1552f6"},{"version":"CommandV1","origId":241715,"guid":"cf1cd88b-87a3-4062-a8e7-e2995bcce21c","subtype":"command","commandType":"auto","position":0.046875,"command":"%md\nArchived YouTube video of this live unedited lab-lecture:\n\n[![Archived YouTube video of this live unedited lab-lecture](http://img.youtube.com/vi/xqy5geCNKCg/0.jpg)](https://www.youtube.com/embed/xqy5geCNKCg?start=1456&end=3956&autoplay=1) [![Archived YouTube video of this live unedited lab-lecture](http://img.youtube.com/vi/qMGKAERggU8/0.jpg)](https://www.youtube.com/embed/qMGKAERggU8?start=0&end=3028&autoplay=1)","commandVersion":0,"state":"error","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":0,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"42e3f146-9109-4010-a1b5-07db9297cfad"},{"version":"CommandV1","origId":226610,"guid":"4b76f759-1cfb-4c0a-801e-ca5f7553a533","subtype":"command","commandType":"auto","position":0.0625,"command":"%md\n\n# Hail Tutorial in Scala for Population Genomics ETL\n## Student Project\nby [Dmytro Kryvokhyzha](https://github.com/evodify) and [Yevgen Ryeznik](https://github.com/yevgenryeznik)\n\nIn this tutorial, we will analyze data from the [1000 Genomes Project](http://www.internationalgenome.org/about) as described in [Analyzing 1000 Genomes with Spark and Hail](https://docs.databricks.com/spark/latest/training/1000-genomes.html) except that we will use [Scala](https://www.scala-lang.org/) instead of [Python](https://www.python.org/).\n\n[Hail](https://hail.is) uses Python wrapper on top of [Apache Spark](https://spark.apache.org/docs/latest/index.html). We re-wrote the [Analyzing 1000 Genomes with Spark and Hail](https://docs.databricks.com/spark/latest/training/1000-genomes.html) tutorial in Scala with some modification and more up-to-date code as our course project for the [Scalable Data Science 2.2](https://lamastex.github.io/scalable-data-science/sds/2/2/) course.\n\nWe believe this tutorial will help to understand the code of Hail better and it will be helpful for those who plan to develop genomic analyses in Scala and contribute to the Hail project.","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":1515099076382,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":true,"iPythonMetadata":null,"streamStates":{},"nuid":"60612db7-2881-4783-a3a6-874d5d44cc54"},{"version":"CommandV1","origId":226611,"guid":"ba60c992-645d-4ec6-8d33-2f5e181f83be","subtype":"command","commandType":"auto","position":0.078125,"command":"%md\n## Introduction\n\nBefore we start, we would like to provide you a short introduction to how the genomic data is obtained and motivate the need to treat it as Big Data.\n","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":1515099076537,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"bb4f1621-ee6b-425b-a758-dd143d1a14de"},{"version":"CommandV1","origId":226612,"guid":"466128de-5011-44bb-bd4b-3d1fb29f75b1","subtype":"command","commandType":"auto","position":0.08203125,"command":"%md\n\n**The importance of big data analyses in genomics is the best explained by this recent paper.**\n\n## [Big Data: Astronomical or Genomical?](http://journals.plos.org/plosbiology/article?id=10.1371/journal.pbio.1002195)\n\n### Abstract\n\nGenomics is a Big Data science and is going to get much bigger, very soon, but it is not known whether the needs of genomics will exceed other Big Data domains. Projecting to the year 2025, we compared genomics with three other major generators of Big Data: astronomy, YouTube, and Twitter. Our estimates show that genomics is a “four-headed beast” - it is either on par with or the most demanding of the domains analyzed here in terms of data acquisition, storage, distribution, and analysis. We discuss aspects of new technologies that will need to be developed to rise up and meet the computational challenges that genomics poses for the near future. Now is the time for concerted, community-wide planning for the “genomical” challenges of the next decade.\n\n<img src=\"http://journals.plos.org/plosbiology/article/figure/image?size=large&id=10.1371/journal.pbio.1002195.g001\" width=\"800\">\n\nThe plot shows the growth of DNA sequencing both in the total number of human genomes sequenced (left axis) as well as the worldwide annual sequencing capacity (right axis: Tera-basepairs (Tbp), Peta-basepairs (Pbp), Exa-basepairs (Ebp), Zetta-basepairs (Zbps)).\n\n\n<img src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/e/e7/Historic_cost_of_sequencing_a_human_genome.svg/800px-Historic_cost_of_sequencing_a_human_genome.svg.png\" width=\"800\">\n\nThe price of genomic data production has also dropped dramatically in the recent years.","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":1515099076706,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"42799601-c582-416b-8cd7-08e059a01540"},{"version":"CommandV1","origId":226613,"guid":"30e9fffd-df3a-45b4-b878-e3cae5c7752d","subtype":"command","commandType":"auto","position":0.0859375,"command":"%md\n\n## DNA sequencing\n\n<img src=\"https://www.yourgenome.org/sites/default/files/illustrations/process/physical_mapping_STS_yourgenome.png\" width=\"800\">\n\nDuring the DNA sequencing procedure, DNA is chopped into small fragments and each fragment is then read by the sequencing machine. Using the variant sites in these DNA fragments (called reads), the overlap in these DNA reads can be found and a continuous genome sequence can be assembled.\n\nHowever, the genome assembly from these short reads is not as trivial as it looks on this picture. So, these genomic reads are usually mapped to the reference genome that has been assembled already. You can see how this mapping looks in the cell below.","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":1515099076862,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"1f9916ce-4d5c-4081-8ec5-02396522764b"},{"version":"CommandV1","origId":226614,"guid":"cc319bde-df01-43b5-a50b-7a099f5ad9fb","subtype":"command","commandType":"auto","position":0.087890625,"command":"%md\n## Aligning millions of small DNA sequences (reads) to a reference genome\n\nYou can obtain this picture by loading your alignment in [BAM](http://software.broadinstitute.org/software/igv/bam) format to the [Integrative Genomics Viewer (IGV)](http://software.broadinstitute.org/software/igv/)\n\n<img src=\"https://github.com/evodify/genomic-analyses_in_apache-spark/raw/master/vcf_filtering_tutorial/genome_read_mapping.png\" width=\"1000\">\n\nThe top panel shows the genomic position in the reference. Next, you can see the vertical bars indicating the depth of coverage in a given position. Those grey horizontal bars represent DNA reads. The grey color in a read means that an allele (nucleotide) is identical to the reference in that position. If the genotype in a certain position is different fro the reference, the alternative allele (nucleotide) is shown. For example, you can see the highlighted heterozygous position that has two alleles. The allele A is covered by 22 reads and it is the reference allele. The allele G is an alternative allele that is why it is designated in reads and it is covered by 15 reads.\n\nGiven this alignment, one can obtain a table of variants in the variant call format (VCF).","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":1515099077012,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"d3e270cb-7e4e-4737-b3b1-c6723f236dda"},{"version":"CommandV1","origId":226615,"guid":"43a2e4ca-d8b3-4bd8-b577-f506e977d6e8","subtype":"command","commandType":"auto","position":0.0888671875,"command":"%scala\n\n// This allows easy embedding of publicly available information into any other notebook\n// when viewing in git-book just ignore this block - you may have to manually chase the URL in frameIt(\"URL\").\n// Example usage:\n// displayHTML(frameIt(\"https://en.wikipedia.org/wiki/Latent_Dirichlet_allocation#Topics_in_LDA\",250))\ndef frameIt( u:String, h:Int ) : String = {\n      \"\"\"<iframe \n src=\"\"\"\"+ u+\"\"\"\"\n width=\"95%\" height=\"\"\"\" + h + \"\"\"\"\n sandbox>\n  <p>\n    <a href=\"http://spark.apache.org/docs/latest/index.html\">\n      Fallback link for browsers that, unlikely, don't support frames\n    </a>\n  </p>\n</iframe>\"\"\"\n   }\ndisplayHTML(frameIt(\"https://en.wikipedia.org/wiki/Variant_Call_Format\",500))\n","commandVersion":0,"state":"finished","results":{"type":"htmlSandbox","data":"<iframe \n src=\"https://en.wikipedia.org/wiki/Variant_Call_Format\"\n width=\"95%\" height=\"500\"\n sandbox>\n  <p>\n    <a href=\"http://spark.apache.org/docs/latest/index.html\">\n      Fallback link for browsers that, unlikely, don't support frames\n    </a>\n  </p>\n</iframe>","arguments":{},"addedWidgets":{},"removedWidgets":[],"datasetInfos":[]},"errorSummary":"Cancelled","error":null,"workflows":[],"startTime":1515099092885,"submitTime":1515099077162,"finishTime":1515099093022,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":true,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"6faede12-31e1-450b-afb0-247f2554a36c"},{"version":"CommandV1","origId":226616,"guid":"b3617fbe-ac9f-4945-a229-9c2dc92b9d4a","subtype":"command","commandType":"auto","position":0.08984375,"command":"%md\n\n## VCF in Hail\n\nHail uses the following scheme for the VCF.\n\n<img src=\"https://hail.is/docs/stable/_images/hail-vds-rep.png\" width=\"600\">\n","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":1515099077326,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"3a59c30c-8335-4787-98c9-3d5663dba152"},{"version":"CommandV1","origId":226617,"guid":"e96fed8d-4f3c-40d8-8d3d-86269a66ea12","subtype":"command","commandType":"auto","position":0.091796875,"command":"%md\n\n# Hail\n\n[Hail](https://hail.is) is an open-source, scalable framework for exploring and analyzing genomic data. Its functionality is exposed through **Python** and backed by distributed algorithms built on top of **Apache Spark** to efficiently analyze gigabyte-scale data on a laptop or terabyte-scale data on a cluster, without the need to manually chop up data or manage job failures. Users can script pipelines or explore data interactively through **Jupyter notebooks** that flow between Hail with methods for genomics, *PySpark* with scalable *SQL* and *machine learning algorithms*, and *pandas* with *scikit-learn* and *Matplotlib* for results that fit on one machine. Hail also provides a flexible domain language to express complex quality control and analysis pipelines with concise, readable code.\n\n#### Scaling Genetic Data Analysis with Apache Spark\n[![Scaling Genetic Data Analysis with Apache Spark](http://img.youtube.com/vi/pyeQusIN5Ao/0.jpg)](https://www.youtube.com/embed/pyeQusIN5Ao)","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":1515099077485,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"3493807a-dbca-46cd-8c9b-0003af236036"},{"version":"CommandV1","origId":226618,"guid":"87da15a4-76e0-4ce2-8831-dc3eff0590d5","subtype":"command","commandType":"auto","position":0.125,"command":"%md \n\n# Cluster setup\n\nFirst, download Hail source code and build `hail-all-spark.jar` file from the source code locally on your computer.\n\nOn Debian-based Linux, install compilers:\n\n```\nsudo apt-get install g++ cmake\n```\nOn Mac OS X, install Xcode, available through the App Store, for the C++ compiler. CMake can be downloaded from the CMake website or through Homebrew. To install with Homebrew, run\n```\n brew install cmake\n```\n\nClone the Hail repository and build:\n```\ngit clone --branch 0.1 https://github.com/broadinstitute/hail.git\ncd hail\n./gradlew -Dspark.version=2.0.2 shadowJar\n```\nYou can also download the pre-built `hail-all-spark.jar` from [here](https://github.com/lamastex/scalable-data-science/tree/master/dbcArchives/2017/parts/studentProjects/Kryvokhyzha-Ryeznik/hail-all-spark.jar).\n\nUpload the built `build/libs/hail-all-spark.jar` to Databricks `Workspace > Shared > Libraries > Create Library` and click `Drop library JAR here to upload`\n\nNext click the `Clusters` icon on the left sidebar and then `+Create Cluster`. For `Apache Spark Version`, select `Spark 2.0 (Auto-updating, Scala 2.11)`. In the Databricks cluster creation dialog, click on the `Spark` tab, and paste the text below into the `Spark config` box.\n\n```\nspark.hadoop.io.compression.codecs org.apache.hadoop.io.compress.DefaultCodec,is.hail.io.compress.BGzipCodec,org.apache.hadoop.io.compress.GzipCodec\nspark.sql.files.openCostInBytes 1099511627776\nspark.sql.files.maxPartitionBytes 10
